def find_min_lucky_number(n: int) -> str:
    from collections import Counter
    c = Counter({1: [-1, 2], 2: [-2, 4], 3: [-3, 6], 4: [0, 1], 5: [-1, 3], 6: [-2, 5]})
    a = n * 7
    s = n // 7
    f = 0
    if a == 0:
        return '7' * s
    else:
        s += c[a][0]
        f += c[a][1]
        if s < 0:
            if n % 4 == 0:
                return '4' * (n // 4)
            else:
                return '-1'
        else:
            return '4' * f + '7' * s

